// App.js

import React from "react";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My React App</h1>
        <p>
          This is a basic React application. Edit <code>App.js</code> and save
          to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
